(57728, 165340, 0, 1, '期限', '別因為工作忙碌而忘記做自己喜歡的事\r\n忙碌不是藉口, 請不要忘記自我\r\n抽一點時間來令自己這生不要後悔吧', '2012-08-01 00:00:00', 2000, 0, 2, 1, '心裡 夢想的己經告終 就在此刻失了蹤 \r\n心裡 在痛 \r\n回想 腦裡一片空 讓我不知所以的 \r\n醉後 漸凍 \r\n\r\n這夜裡 要共醉 在這星空 \r\n我害怕 這夜晚 瞬間到末日 \r\n天早已預告這限期 在這地 \r\n\r\n誰願在這漆黑一角 每日裡也在拼著忙 \r\n淮把生命流放 花光所有時光 \r\n害怕己沒法 來延續這星火 \r\n需跨過 美麗晚空照耀我 \r\n無悔 用我這一生餘光 \r\n\r\n這裡 再可多幾個秋與冬 還剩幾多秋與冬\r\n心碎 美好的突然失蹤 \r\n\r\n不想知那夜裡 要獨醉 在這天空 \r\n我害怕 這夜晚 瞬間到末日 \r\n天早已預計這限期 就降在這裡 \r\n\r\n誰願在這漆黑一角 每日裡也在拼著忙 \r\n淮把生命流放 花光所有時光 \r\n害怕己沒法 來延續這星火 \r\n需跨過 美麗晚空照耀我 \r\n無悔 用我這一生餘光 \r\n\r\n誰願在這漆黑一角 每日裡也在拼著忙 \r\n淮把生命流放 花光所有時光 別再躲 \r\n\r\n其實我己經 不清楚 每日裡也在拼著忙 \r\n不知道為誰過 得到那是什麼 \r\n害怕己沒法 來延續這首歌 想起我 \r\n最後晚曲 也在播 無悔 用我這一生時光', '', 265, '', 'ApphiA', 'ApphiA', '', '', '', 0, 1, 0, '2012-12-20 15:30:52', '2015-03-12 13:57:49', '0000-00-00 00:00:00'),
