(57797, 81092, 0, 1, '夢不止熄(Non Stop)', 'Non Stop一詞常常使用於運輸工具上，如直達列車、直達班機，表示中途不停靠不間斷，帶著這樣的背景便將歌曲命名為《夢不止熄》。在「友誼」裡，述說著友誼長存，在「夢想」上，象徵著無懼的往目標前行。大學是人生一段美妙的協奏曲，雖說不是主要的橋段卻不可抹去它的重要性，也好比是蒲公英生長旅程般，四年的生活，使我們再同一個母體成長，那就是「銘傳大學」，如今我們成熟了、開花了，每個人即將隨著風飛向屬於自己的另一片小小世界，同學間的離別，更像蒲公英花的降落，究竟會到哪裡誰也不得而知，心中依然記得一起經歷過的點點滴滴，雖然不捨，但面對未來挑戰的時候，這份回憶、這份感動都會化做動力，伴隨我們繼續成長，繼續堅強使我們不再畏懼，勇敢的朝自己夢想前進！', '2012-12-20 00:00:00', 2000, 0, 1, 7, '夢不止熄(Non Stop)\r\n詞：阿給(王峻維)、威廉(洪維聯)\r\n曲：威廉(洪維聯)\r\n\r\n【Verse 1】\r\n還記得那一天 期待這場冒險 \r\n初次嘗到生活中 充滿新鮮\r\n一起用心描繪 打造心中樂園\r\n寫下奇蹟的詩篇 笑著流淚\r\n\r\n【Verse 2】\r\n終於來到這天 成長的新起點\r\n忘不去的畫面都 值得回味 \r\n約定會是永遠 把它種在心田\r\n耐心的灌溉祝福 彼此心願\r\n\r\n【Pre Chorus】\r\n像蒲公英 四處飛行 停留之後 又往哪裡\r\n哼著旋律 能否想起 最動人的呼吸 \r\n\r\n【Chorus 1】\r\nNon Stop 開啟屬於我自己的明天 \r\n不畏懼的走 衝破象限 不顧一切\r\n誰不害怕黑夜 害怕疆界\r\n友誼曙光指引著向前 \r\n\r\nNon Stop 盡情揮灑汗水 直到永遠 \r\n努力的實現 心中的夢 不顧一切 \r\n昂首仰望藍天 守著信念 \r\n把每一天當最後一天 \r\n\r\n【Chorus 2】\r\nNon Stop 追逐風的腳步飛得更遠\r\n別害怕墜落 堅持航線 不顧一切\r\n逆著風很疲憊 轉身面對\r\n就能順遂的繼續往前\r\n\r\nNon Stop 這一生給自己太多妥協 \r\n有沒有機會 追逐夢想 不顧一切 \r\n讓我用力的追 用力的飛 \r\n降落在最美麗的終點', '', 213, '', '洪維聯', '王峻維 洪維聯', '黃冠倫', '', '', 0, 1, 0, '2012-12-20 23:06:35', '2015-03-12 13:57:51', '0000-00-00 00:00:00'),
