(57803, 139485, 5372, 1, 'Silver Soul', 'If there''s any possible to be mine\r\nHow can I denied the flare in mind\r\nI know deep inside, you want it so bad...\r\n\r\nSILVER SOUL是我們一直很喜愛的一首歌，也是舞台上的必備曲目。新的編曲中，除了極具律動感的對點、對比分明的清、吼腔、急停急跑的休止符，我們也嘗試營造更鮮明的空間感，與更強烈的疾走感。在這些聲音下，我們想說的是：\r\n\r\n夢想，不是光放在眼前看著，放在嘴上說說，或拿來跟別人炫耀的。\r\n\r\n夢想，是為了自己，為了想要一同追尋的伙伴，努力燃燒、拼命掙扎；不管再累、付出再多、跌倒的姿勢有多難看，夢想是為了讓自己變得更好而存在的。\r\n\r\n沒有任何人的夢想應該被嘲笑，沒有任何夢想是沒有可能的。\r\n祝福所有人都用自己最平衡的方式去生活，去盡力，然後得到你的夢想。\r\n\r\n「如果有一丁點可能掌握在我手裡\r\n我怎麼能否認心中燃燒的光芒\r\n我知道在心底，你是如此的渴望…」\r\n\r\n我們的第一首曲目，希望大家喜歡:)\r\n\r\nチックナップのデモ音源リリース第一弾！”SILVER SOUL"\r\n直接的、パワー満点の一曲\r\nVOCALの JAYKOの全身全霊の作品です！！！\r\n\r\n是非聞いてください！', '2012-12-27 00:00:00', 2012, 0, 1, 10, '', '[Silver Soul]\n\nBy J&Q\n \n\nEnding soon\n就快要結束了\n\nGoing off\n一切告吹\n\nGetting everything pulverized\n所有東西灰飛煙滅\n\nBreaking soon\n迅速崩壞\n\nTo ruin you\n把你幹掉\n\nThe weakest flames but still shines \n依舊閃爍的微弱光芒\n\n\nIf there''s any possible to be mine\n如果有一丁點可能掌握在我手裡\n\nHow can I denied the flare in mind\n我怎麼能否認心中燃燒的光芒\n\n\n(Break it, break it)\n破壞它\n\nI''ll crumble it down\n我會用力將它粉碎\n\nRest in hell\n扔到地獄裡\n\nIt will be glad just to see it down\n看它崩潰一定很爽\n\n(Come on, come on)\n快來吧\n\nI feel comfort\n我覺得很安心\n\nWhen seeing you cry\n看見你哭的樣子\n\nFeeling disturbed\n覺得心煩\n\nWhen you looking so fine\n當一切看起來幸福快樂的時候\n\nYou got me\n你讓我\n\n(Wake up , wake up)\n清醒點\n\nI know deep inside\n我知道在你心底\n\nYou want it so bad\n你是如此的渴望\n \n\nFine to lose\n輸了也可以\n\nFine to down\n失望也可以\n\nFine for trying and falling down\n站起來又被打倒也無所謂\n\nFine for the grief\n傷痛不要緊\n\nFine for the fact\n現實也還可以\n\nThe fact you choose believe in now\n你選擇相信的就是現實\n\n\nIf there''s any possible to be mine\n如果有一丁點可能掌握在我手裡\n\nHow can I denied the flare in mind\n我怎麼能否認心中燃燒的光芒\n\n\n(Break it, break it)\n破壞它\n\nI''ll crumble it down\n我會用力將它粉碎\n\nRest in hell\n扔到地獄裡\n\nIt will be glad just to see it down\n看它崩潰一定很爽\n\n(Come on, come on)\n快來吧\n\nI feel comfort\n我覺得很安心\n\nWhen seeing you cry\n看見你哭的樣子\n\nFeeling disturbed\n感到心煩\n\nWhen you looking so fine\n當一切看起來幸福快樂的時候\n\nYou got me\n你讓我\n\n(Wake up , wake up)\n清醒點\n\nI know deep inside\n我知道在你心底\n\nYou want it so bad\n你是如此的渴望\n\n\nIf there''s any possible to be mine\n如果有一丁點可能掌握在我手裡\n\nHow can I denied the flare in mind\n我怎麼能否認心中燃燒的光芒\n\n\n(Break it, break it)\n破壞它\n\nI''ll crumble it down\n我會用力將它粉碎\n\nRest in hell\n扔到地獄裡\n\nIt will be glad just to see it down\n看它崩潰一定很爽\n\n(Come on, come on)\n快來吧\n\nI feel comfort\n我覺得很安心\n\nWhen seeing you cry\n看見你哭的樣子\n\nFeeling disturbed\n感到心煩\n\nWhen you looking so fine\n當一切看起來幸福快樂的時候\n\nYou got me\n你讓我\n\n(Wake up , wake up)\n清醒點\n\nI know deep inside\n我知道在你心底\n\nYou want it\n你就是要它\n\n(So Break it, break it)\n破壞它吧\n\nI''ll crumble it down\n我會用力將它粉碎\n\nRest in hell\n扔到地獄裡\n\nIt will be glad just to see it down\n看它崩潰一定很爽\n\n(Come on, come on)\n快來吧\n\nI feel comfort\n我覺得很安心\n\nWhen seeing you cry\n看見你哭的樣子\n\nFeeling disturbed\n感到心煩\n\nWhen you looking so fine\n當一切看起來幸福快樂的時候\n\nYou got me\n你讓我\n\n(Wake up , wake up)\n清醒點\n\nI know deep inside\n我知道在你心底\n\nYou want it so bad\n你是如此的渴望', 194, '', '', '', '', '', '', 0, 1, 0, '2012-12-21 01:23:55', '2015-03-12 13:57:51', '0000-00-00 00:00:00');
